import React from 'react';

import ImgHeader from '../Images/header.jpg';
import './Header.css';
import 'bootstrap/dist/css/bootstrap.min.css';


function Header(){
    return(
    <header className="header">
        <img src={ImgHeader} alt="_blank" className="imgHeader"/>
        <h1 className="headerTitle">Una frase con la que te van a brillar los ojitos !</h1>
        
    </header>
    )
}

export default Header;
